import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navbar";

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {rows: <p>this is row</p>}
  }
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <main className="container" />
      </React.Fragment>


    );
    
  }
}

export default App;
